import React, { useState } from "react";
import {
  Typography,
  Grid,
  Tabs,
  Tab,
  Paper,
} from "@material-ui/core";
import * as Icons from "@material-ui/icons";

// styles
import useStyles from "./styles";

// components
import PageTitle from "../../components/PageTitle/PageTitle";


// icons sets
import "font-awesome/css/font-awesome.min.css";

export default function IconsPage () {
  var classes = useStyles();

  // local
  var [activeTabId, setActiveTabId] = useState(0);

  return (
  <>
    <PageTitle title="Icons" button="Action" />
    <Paper className={classes.iconsContainer}>
      <Tabs
        indicatorColor="primary"
        textColor="primary"
        value={activeTabId}
        onChange={(e, id) => setActiveTabId(id)}
        className={classes.iconsBar}
      >
        <Tab label="Material Icons" classes={{ root: classes.tab }} />
        <Tab label="Font Awesome" classes={{ root: classes.tab }} />
      </Tabs>
      {activeTabId === 0 && (
        <div>
          <Grid container spacing={2} className="icon-list">
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessAlarm />
              <Typography className={classes.materialIconText}>
                AccessAlarm
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessAlarms />
              <Typography className={classes.materialIconText}>
                AccessAlarms
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Accessibility />
              <Typography className={classes.materialIconText}>
                Accessibility
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Accessible />
              <Typography className={classes.materialIconText}>
                Accessible
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessibleForward />
              <Typography className={classes.materialIconText}>
                AccessibleForward
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccessTime />
              <Typography className={classes.materialIconText}>
                AccessTime
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBalance />
              <Typography className={classes.materialIconText}>
                AccountBalance
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBalanceWallet />
              <Typography className={classes.materialIconText}>
                AccountBalanceWallet
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountBox />
              <Typography className={classes.materialIconText}>
                AccountBox
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AccountCircle />
              <Typography className={classes.materialIconText}>
                AccountCircle
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AcUnit />
              <Typography className={classes.materialIconText}>
                AcUnit
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Adb />
              <Typography className={classes.materialIconText}>Adb</Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.Adjust />
              <Typography className={classes.materialIconText}>
                Adjust
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatFlat />
              <Typography className={classes.materialIconText}>
                AirlineSeatFlat
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatFlatAngled />
              <Typography className={classes.materialIconText}>
                AirlineSeatFlatAngled
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatIndividualSuite />
              <Typography className={classes.materialIconText}>
                AirlineSeatIndividualSuite
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomExtra />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomExtra
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomNormal />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomNormal
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatLegroomReduced />
              <Typography className={classes.materialIconText}>
                AirlineSeatLegroomReduced
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatReclineExtra />
              <Typography className={classes.materialIconText}>
                AirlineSeatReclineExtra
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirlineSeatReclineNormal />
              <Typography className={classes.materialIconText}>
                AirlineSeatReclineNormal
              </Typography>
            </Grid>
            <Grid
              className={classes.materailIcon}
              item
              md={3}
              lg={2}
              sm={4}
              xs={12}
            >
              <Icons.AirplanemodeActive />
